import React from 'react';
import logo from '../../logo.svg';
import { Counter } from '../../features/counter/Counter';
import './Home.css';
import SwapCard from 'components/Controllers/SwapCard';

const Home = () => {
  return (
    <div>
      <div className="Home-header">
        <img src={logo} className="Home-logo" alt="logo" />
        <SwapCard />
        <p></p>
        <span>
          <span>Learn </span>
          <a className="Home-link" href="https://reactjs.org/" target="_blank" rel="noopener noreferrer">
            React
          </a>
          <span>, </span>
          <a className="Home-link" href="https://redux.js.org/" target="_blank" rel="noopener noreferrer">
            Redux
          </a>
          <span>, </span>
          <a className="Home-link" href="https://redux-toolkit.js.org/" target="_blank" rel="noopener noreferrer">
            Redux Toolkit
          </a>
          ,<span> and </span>
          <a className="Home-link" href="https://react-redux.js.org/" target="_blank" rel="noopener noreferrer">
            React Redux
          </a>
        </span>
      </div>
    </div>
  );
};

export default Home;
